import React from "react";
import { Helmet } from "react-helmet";
import Navbar from "./components/Navbar/Navbar";

const Main = ({ children, pageTitle, pageClass }) => {
  return (
    <div className="ear-health">
      <Helmet>
        <title>{`${pageTitle}`} | Ear Health</title>
      </Helmet>
      <Navbar />
      <div>
      {children}
      </div>
      {/* Footer goes here */}
    </div>
  );
};

export default Main
